import React from 'react';
import Button from '../Button';
import Input  from '../Input';
import styled from 'styled-components';

const WelcomeCont = styled.div`
    display: flex;
    flex-direction: column;
`;

const ForgotCont = styled.p`
    color: #4285F4;
    right: 0px;
    font-family: sans-serif;
    // display: flex;
    // align-items: flex-end;
`;

const Welcome = ({}) => {
    return <WelcomeCont>
        <h1 >Welcome Back!</h1>

        <Button text='Login with Google' radius='0px' img={img}></Button>

        <p>or</p>

        <Input text='EMAIL' PHtext='joe@gmail.com'></Input>

        <Input text='PASSWORD' PHtext='••••••••••••••••'></Input>

        <ForgotCont>Forgot password?</ForgotCont>

            <Button text='Login'></Button>

            <Button text='Signup' bgcolor='#D79B9B'></Button>

    </WelcomeCont>
}

export default Welcome;
